	(21, 2, 1, 'Uno de los Ã³rganos mÃ¡s importante de nuestro cuerpo es la piel, pues cumple funciones como regular la temperatura, evitar la pÃ©rdida de agua, protegernos de bacterias, entre muchas otras. Al ser una capa protectora, tiene grandes riesgos de sufrir complicaciones que se conocen como heridas, es decir, lesiones que se producen por traumatismos y se definen como la pÃ©rdida de la continuidad de la piel. ', 'Heridas-text-description', 'Heridas-text-description', 1, '2022-03-09 03:29:23', '2022-03-09 03:29:23'),
