	(26, 2, 1, 'Durante el proceso de cicatrizaciÃ³n, el cuerpo humano realiza la reparaciÃ³n de los tejidos y estos van cambiando de aspecto, por lo que es importante que usted reconozca el tipo de tejido presente en una herida:', 'heridas-type', 'heridas-type', 1, '2022-03-09 15:13:08', '2022-03-09 15:13:08'),
