	(28, 2, 1, 'NecrÃ³tico: tejido negro que puede estar hÃºmedo o seco. Normalmente es el tejido al que se le llama escara y no es bueno para la lesiÃ³n. Bajo este tejido, su lesiÃ³n puede o no tener profundidad. ', 'prueba2', 'Heridas-tipo1-text', 1, '2022-03-09 15:51:38', '2022-03-10 01:29:03'),
