	(47, 2, 1, 'Factores que afectan la cicatrizaciÃ³n de las heridas quirÃºrgicas', 'titulo', 'heridas-factores-titulo', 1, '2022-03-10 02:23:01', '2022-03-10 02:23:01'),
	(48, 2, 1, 'El proceso de cicatrizaciÃ³n de una herida quirÃºrgica puede verse afectado por diferentes factores como aquellos propios de la persona o del ambiente, por lo tanto, es importante conocerlos e identificarlos a tiempo para poder dar un manejo oportuno e integral al proceso de cicatrizaciÃ³n o curaciÃ³n por parte del equipo de salud.', 'Heridas texto', 'Heridas-text-description1', 1, '2022-03-10 02:23:50', '2022-03-10 02:23:50'),
	(49, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/cuadro2.png', 'heridas-Cuadro', 'heridas-cuadro-1', 1, '2022-03-10 02:25:17', '2022-03-10 02:25:17'),
	(50, 2, 1, 'Estas complicaciones pueden retrasar el proceso de cierre de la herida y generar complicaciones mayores, por lo que es importante identificarlas y poder acudir a un servicio de urgencias o una consulta prioritaria, para comentarlo con su mÃ©dico tratante o el equipo de clÃ­nica de heridas.Seroma (acumulaciÃ³n de grasa en la herida)', 'Texto-1', 'Heridas-text-description2', 1, '2022-03-10 02:26:20', '2022-03-10 02:26:20'),
	(51, 2, 1, 'Â¿CÃ³mo identificar estas complicaciones?', 'Heridas titulo1', 'Heridas-titulo2', 1, '2022-03-10 02:27:20', '2022-03-10 02:27:20'),
	(52, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/hematomas.png', 'Hematomas', 'Heridas-imagen-12', 1, '2022-03-10 02:28:43', '2022-03-10 02:28:43'),
	(53, 2, 1, 'Signos de infecciÃ³n de la herida quirÃºrgica     ', 'Titulo3', 'Heridas_titulo3', 1, '2022-03-10 02:29:37', '2022-03-10 02:29:37'),
	(54, 2, 1, 'La infecciÃ³n del sitio operatorio (ISO) es la segunda causa de infecciÃ³n nosocomial (hospitalaria) mÃ¡s frecuente. Los pacientes a los que se les realiza cirugÃ­a limpia intrabdominal tienen una posibilidad de desarrollar infecciones del sitio operatorio entre 2 % y 5 %, mientras que los pacientes a quienes se les practica un procedimiento abdominal tienen una posibilidad de hasta un 20 %.\r\n\r\nSi usted detecta los signos y sÃ­ntomas que se presentan a continuaciÃ³n en su herida quirÃºrgica, puede tratarse de una complicaciÃ³n o infecciÃ³n en el sitio quirÃºrgico. En ese caso, debe acudir a un servicio de urgencias para ser tratado por personal salud experto en el tema.', 'Texto5', 'Herida-texto-4', 1, '2022-03-10 02:30:26', '2022-03-10 02:30:26'),
	(55, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/dolor.png', 'dolor', 'Heridas_imagen-13', 1, '2022-03-10 02:31:42', '2022-03-10 02:31:42'),
	(56, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/sintomas.png', 'Sintomas', 'Heridas_imagen-14', 1, '2022-03-10 02:33:21', '2022-03-10 02:33:21'),
	(57, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/cuidar.png', 'Cuidar', 'Heridas_imagen-15', 1, '2022-03-10 02:34:12', '2022-03-10 02:34:12'),
	(58, 2, 1, 'Recuerde siempre la importancia de consultar con su mÃ©dico tratante o personal idÃ³neo en el manejo de las heridas', 'mÃ©dico-texto', 'Heridas_texto-17', 1, '2022-03-10 02:34:58', '2022-03-10 02:34:58'),
	(59, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/pepe.png', 'FondoBackground', 'Fondo-Background1', 1, '2022-03-10 03:12:21', '2022-03-10 03:12:21'),
	(60, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/ulceras.png', 'Ãšlceras por presiÃ³n', 'Ãšlceras-Banner-1', 1, '2022-03-10 03:17:29', '2022-03-10 03:17:29'),
