	(77, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/diabetes1.png', ' Pie lastimado por diabetes', 'diabetes-banner-1', 1, '2022-03-10 16:20:15', '2022-03-10 16:20:15'),
	(78, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/diabetes-2.png', 'Background', 'diabetes-background-1', 1, '2022-03-10 16:22:49', '2022-03-10 16:22:49'),
	(79, 2, 1, 'SegÃºn la OrganizaciÃ³n Mundial de la Salud (OMS), en el mundo existen 442 millones de adultos con diabetes. En Colombia, la Cuenta de Alto Costo en su informe del 2021 determinÃ³ que entre el 1 de julio del 2019 y el 30 de junio del 2020 se reportaron 1 426 574 personas con diagnÃ³stico de diabetes mellitus, para un prevalencia de 2,86 casos por cada 100 habitantes y una incidencia de 168 778 casos nuevos de esta enfermedad. \r\n</br>\r\n</br>\r\nLa diabetes ha tenido un crecimiento importante en el mundo y Colombia no es la excepciÃ³n. Debido al aumento del nÃºmero de personas que padecen diabetes, las preocupaciones de sus cuidadores y familias se convierten tambiÃ©n en un foco de atenciÃ³n. La educaciÃ³n conjunta de cuidadores, familias y pacientes es fundamental para la aceptaciÃ³n, prevenciÃ³n y tratamiento de la diabetes.  ', ' Generalidades sobre la diabetes', 'diabetes-text-1', 1, '2022-03-10 16:24:54', '2022-03-10 16:24:54'),
	(80, 2, 1, 'Mitos y verdades sobre la diabetes', 'Mitos y verdades sobre la diabetes', 'diabetes-titulo-1', 1, '2022-03-10 16:26:05', '2022-03-10 16:26:05'),
	(81, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/diabetes3.png', 'Mitos sobre la diabetes', 'diabetes-cuadros-1', 1, '2022-03-10 16:27:16', '2022-03-10 19:04:36'),
	(82, 2, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/diabetes4.png', 'Verdades sobre la diabetes', 'diabetes-cuadros-2', 1, '2022-03-10 16:28:24', '2022-03-10 19:04:44'),
