	(84, 2, 1, 'La diabetes eleva el azÃºcar en la sangre a un nivel mÃ¡s alto de lo normal. DespuÃ©s de muchos aÃ±os, la acumulaciÃ³n de azÃºcar en la sangre puede traer problemas de salud. Si esta no se detecta a tiempo o no es controlada, los problemas que se producen pueden ser mÃ¡s complicados, por ejemplo:', 'Problemas de salud en los pacientes diabÃ©ticos?', 'diabetes-text-2', 1, '2022-03-10 16:30:29', '2022-03-10 16:30:29'),
