	(93, 2, 1, 'Los hÃ¡bitos de vida saludables son una serie de acciones que las personas y la sociedad pueden adoptar para disminuir los riesgos o complicaciones de enfermedades durante su vida. Las familias y/o los cuidadores deben apoyar el cambio de estos hÃ¡bitos en los pacientes con diabetes para que sean permanentes en su dÃ­a a dÃ­a, ademÃ¡s de modificar sus propios hÃ¡bitos para contribuir a la disminuciÃ³n de los riesgos a los que estÃ¡n expuestos los pacientes con diabetes.', 'Vida saludable en los pacientes diabÃ©ticos', 'diabetes-text-3', 1, '2022-03-10 16:45:04', '2022-03-10 16:45:04'),
