	(96, 2, 1, 'Las personas que padecen diabetes deben ajustar su dieta de forma permanente a fin de mantener los niveles de azÃºcar en la sangre regulados, disminuir el riesgo de hipoglicemia (azÃºcar baja en la sangre), hiperglicemia (azÃºcar alta en la sangre), entre otros. \r\n</br>\r\n</br>\r\nDentro de las modificaciones es importante distribuir la ingesta de alimentos en seis comidas al dÃ­a, evitando comer de mÃ¡s y tomando las porciones adecuadas, aumentar la ingesta de lÃ­quido y evitar el consumo de comidas no sanas.', 'habitos salud', 'diabetes-text-4', 1, '2022-03-10 16:50:35', '2022-03-10 16:50:35'),
