	(98, 2, 1, 'La American Diabetes Association (AsociaciÃ³n Americana de la Diabetes) diseÃ±Ã³ una herramienta que puede ayudar a adoptar un estilo de vida saludable. Se trata de un mÃ©todo sencillo para que usted planifique sus comidas de forma mÃ¡s saludable.', 'Estas imÃ¡genes estÃ¡n invertidas', 'diabetes-text-5', 1, '2022-03-10 16:55:25', '2022-03-10 16:55:25'),
