	(140, 3, 1, 'Material disponible solo para profesionales de la salud.\r\n</br>\r\n</br>\r\nEs un medicamento desarrollado por el Centro de IngenierÃ­a GenÃ©tica y BiotecnologÃ­a de La Habana (CIGB) para el tratamiento de las Ãºlceras de pie diabÃ©tico (UPD) y Ãºlceras de origen vascular. Este producto, basado en el factor de crecimiento epidÃ©rmico recombinante humano (FCErh), estimula la proliferaciÃ³n de fibroblastos, queratinocitos y cÃ©lulas endoteliales de vasos, lo cual contribuye a sus propiedades cicatrizantes.', 'Product texto ', 'producto_epiprot_texto_1', 1, '2022-03-10 22:38:13', '2022-03-10 22:38:13'),
	(141, 3, 1, 'ComposiciÃ³n', 'Producto titulo 1', 'producto_titulo-2', 1, '2022-03-10 22:40:07', '2022-03-10 22:40:07'),
