	(144, 3, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/producto1.png', 'ComposiciÃ³n de Epiprot', 'producto_imagen-1', 1, '2022-03-10 22:44:15', '2022-03-10 22:44:15'),
	(145, 3, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/producto2.png', 'ComposiciÃ³n de Epiprot ', 'Producto_text_2', 1, '2022-03-10 22:45:37', '2022-03-10 22:45:37'),
