	(173, 3, 1, 'VulcosanÂ® PHMB Antimicrobial Complex es un apÃ³sito estÃ©ril listo para su uso, impregnado con una soluciÃ³n lÃ­quida de PHMB Antimicrobial Complex. La soluciÃ³n sirve para la descontaminaciÃ³n y la profilaxis de la infecciÃ³n frente a microorganismos y para la protecciÃ³n preventiva frente a patÃ³genos bacterianos y fungales en heridas agudas o crÃ³nicas.\r\n</br>\r\n</br>\r\nLa combinaciÃ³n de componentes de VulcosanÂ® PHMB, de gran eficacia, disuelve la biopelÃ­cula (biofilm), limpia la herida y crea un entorno Ã³ptimo para favorecer la formaciÃ³n de tejido de granulaciÃ³n. ', ' Â¿QuÃ© es Vulcosan de Praxis Pharmaceutical?', 'vulcosan_texto_1', 1, '2022-03-11 04:30:25', '2022-03-11 04:30:25'),
