	(214, 4, 1, 'Se cuida de un paciente, familiar o amigo por diferentes motivos. Por ejemplo, porque el grupo familiar delega dicha responsabilidad, por ser la Ãºnica persona con la que se cuenta para esta labor, por un deber moral con el otro, por apariencia social, por agradecimiento, entre otros motivos. <b>El cuidado es una responsabilidad voluntaria o asignada que debe realizarse con dedicaciÃ³n y respeto por quien se cuida.</b>', ' Razones por las que se cuida', 'aliados_texto_2', 1, '2022-03-11 07:22:22', '2022-03-11 07:22:22'),
