	(218, 4, 1, 'Sobrecarga del cuidador', 'Sobrecarga del cuidador', 'aliados_titulo_4', 1, '2022-03-11 07:26:39', '2022-03-11 07:26:39'),
	(219, 4, 1, 'Cuidar de otra persona es asumir responsabilidades que seguramente no se tenÃ­an presentes, pues se dan cambios en la dinÃ¡mica familiar y social que generan mÃ¡s actividades, compromisos y responsabilidades, lo que hace del cuidado un proceso de aprendizaje lleno de emociones, sentimientos y reacciones fÃ­sicas que pueden provocar una sobrecarga importante en el cuidador.\r\n </br>\r\nA esto se le denomina â€œsÃ­ndrome de sobrecarga del cuidadorâ€ o â€œsÃ­ndrome del cuidador quemadoâ€, referido por la fundaciÃ³n Pascal Maragall. Este sÃ­ndrome es un estado de agotamiento emocional y fÃ­sico que experimentan las personas que dedican gran parte de su tiempo al cuidado de una persona dependiente, sin contar con el agravante emocional de sentir que se pierde en vida la esencia de un ser querido.', 'Cuidar ', 'aliados_texto_4', 1, '2022-03-11 07:27:27', '2022-03-11 07:27:27'),
	(220, 4, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/aliados_background.png', 'background aliados', 'aliados_background_1', 1, '2022-03-11 07:28:52', '2022-03-11 07:28:52'),
