	(236, 4, 2, 'http://api-praxis.test/wp-content/uploads/2022/03/video.png', 'Â¿QuÃ© es el factor de crecimiento epidÃ©rmico recombinante humano?', 'banner_video', 1, '2022-03-11 07:49:14', '2022-03-11 07:49:14'),
	(237, 4, 1, 'El factor de crecimiento epidÃ©rmico recombinante humano (FCErh) o nepidermina es un polipÃ©ptido que desempeÃ±a, junto con las hormonas y los neurotransmisores, una funciÃ³n relevante en la comunicaciÃ³n intercelular. AdemÃ¡s, ha permanecido en el fondo genÃ©tico a lo largo del proceso evolutivo.\r\n</br>\r\n</br>\r\nSu estructura se conserva de modo notable, posee una elevada homologÃ­a entre las especies y, por tanto, su actividad biolÃ³gica es cruzada. Este Ãºltimo aspecto ha sido esencial para el desarrollo de estudios experimentales farmacolÃ³gicos y toxicolÃ³gicos que emplean el FCE de origen natural o humano recombinante. \r\n</br>\r\n</br>\r\nSu descubrimiento por Stanley Cohen estuvo precedido por la identificaciÃ³n de los efectos epiteliotropos del FCE en ratones de laboratorio, a los que se les administrÃ³ un preparado semipuro, extraÃ­do a partir de sus propias glÃ¡ndulas salivales. La conservaciÃ³n filogenÃ©tica del FCE en los animales y el hombre, y su amplia distribuciÃ³n en tejido', 'text1', 'text_factores', 1, '2022-03-11 07:53:57', '2022-03-11 07:53:57'),
