	(1, 1, '2022-02-23 14:13:32', '2022-02-23 19:13:32', '<!-- wp:paragraph -->\n<p>Bienvenido(a) a WordPress. Esta es tu primera entrada. EdÃ­tala o bÃ³rrala Â¡y comienza a publicar!</p>\n<!-- /wp:paragraph -->', 'Â¡Hola mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2022-02-23 14:13:32', '2022-02-23 19:13:32', '', 0, 'http://api-praxis.test/?p=1', 0, 'post', '', 1),
	(2, 1, '2022-02-23 14:13:32', '2022-02-23 19:13:32', '<!-- wp:paragraph -->\n<p>Esta es una pÃ¡gina de ejemplo. Es diferente de una entrada de blog porque se quedarÃ¡ en ese lugar y se mostrarÃ¡ en la navegaciÃ³n de tu sitio (en la mayorÃ­a de los temas). La mayorÃ­a de la gente comienza con una pÃ¡gina de acerca de que los introduce a los visitantes potenciales del sitio. PodrÃ­a decir algo como esto:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>Â¡Hola! Soy un Mensajero en bici durante el dÃ­a, aspirante a actor de noche, y este es mi sitio Web. Vivo en los Ãngeles, tengo un gran perro llamado Jack, y me gustan las piÃ±as coladas. (Y estar atrapados en la lluvia.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>â€¦o algo asÃ­:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>La Empresa Doohickey XYZ fue fundada en 1971, y ha estado proporcionando cosas de calidad al pÃºblico desde entonces. Ubicado en la ciudad de Gotham, XYZ emplea a mÃ¡s de 2.000 personas y hace todo tipo de cosas impresionantes para la comunidad gÃ³tica.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como nuevo usuario de WordPress, debes ir a <a href="http://api-praxis.test/wp-admin/">tu Escritorio</a> para eliminar esta pÃ¡gina, y asÃ­ crear nuevas pÃ¡ginas para su contenido. Â¡Que te diviertas!</p>\n<!-- /wp:paragraph -->', 'PÃ¡gina de ejemplo', '', 'publish', 'closed', 'open', '', 'pagina-ejemplo', '', '', '2022-02-23 14:13:32', '2022-02-23 19:13:32', '', 0, 'http://api-praxis.test/?page_id=2', 0, 'page', '', 0),
	(3, 1, '2022-02-23 14:13:32', '2022-02-23 19:13:32', '<!-- wp:heading --><h2>QuiÃ©nes somos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Nuestra direcciÃ³n de sitio web es: http://api-praxis.test.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comentarios</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Cuando los visitantes dejan comentarios en el sitio recopilamos los datos mostrados en el formulario de comentarios, y tambiÃ©n la direcciÃ³n IP del visitante y la cadena del agente de usuario del navegador para ayudar a la detecciÃ³n de spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Se puede proporcionar una cadena anÃ³nima creada a partir de su direcciÃ³n de correo electrÃ³nico (tambiÃ©n denominada hash) al servicio gravatar para ver si la estÃ¡ utilizando. La polÃ­tica de privacidad del servicio Gravatar estÃ¡ disponible aquÃ­: https://automattic.com/privacy/. DespuÃ©s de la aprobaciÃ³n de tu comentario, su imagen de perfil serÃ¡ visible para el pÃºblico en el contexto de tu comentario.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Medios</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si subes imÃ¡genes al sitio web, debes evitar cargar imÃ¡genes con datos de ubicaciÃ³n incrustados (EXIF GPS). Los visitantes del sitio web pueden descargar y extraer los datos de la ubicaciÃ³n de las imÃ¡genes en el sitio Web.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si deja un comentario en nuestro sitio, puedes optar por guardar tu nombre, direcciÃ³n de correo electrÃ³nico y sitio web en cookies. Estos es para tu comodidad y no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendrÃ¡n un aÃ±o de duraciÃ³n.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si visitas nuestra pÃ¡gina de Acceso, se instalarÃ¡ una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Cuando inicies sesiÃ³n, se instalarÃ¡n varias cookies para guardar tu informaciÃ³n de acceso y opciones de visualizaciÃ³n de pantalla. Las cookies de acceso permanecerÃ¡n por dos dÃ­as y las cookies de opciones de pantalla se guardarÃ¡n por un aÃ±o. Si seleccionas Â«RecuÃ©rdarmeÂ» en tu inicio de sesiÃ³n, estas se guardarÃ¡n por dos semanas. Si cierra la sesiÃ³n de tu cuenta, las cookies de acceso se eliminarÃ¡n.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si editas o publicas un artÃ­culo se guardarÃ¡ una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del artÃ­culo que acabas de editar. Caduca despuÃ©s de 1 dÃ­a.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Contenido incrustado de otros sitios web</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Los artÃ­culos de este sitio pueden incluir contenido incrustado (por ejemplo, vÃ­deos, imÃ¡genes, artÃ­culos, etc.). El contenido incrustado de otras webs se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interacciÃ³n con ese contenido incrustado, incluido el seguimiento de tu interacciÃ³n con el contenido incrustado si tienes una cuenta y estÃ¡s conectado a esa web.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Con quiÃ©n compartimos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si solicitas un restablecimiento de contraseÃ±a, tu direcciÃ³n IP serÃ¡ incluida en el correo electrÃ³nico de restablecimiento.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>CuÃ¡nto tiempo conservamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar automÃ¡ticamente cualquier comentario de seguimiento en lugar de mantenerlos en una cola de moderaciÃ³n.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Para los usuarios que se registren en nuestro sitio web (si los hay), se almacenarÃ¡n todos sus datos de informaciÃ³n personal que proporcionen. Cualquier usuario puede ver, editar o eliminar su informaciÃ³n personal cuando lo desee (a excepciÃ³n del nombre de usuario que no se puede editar). Los administradores de sitios web, tambiÃ©n pueden ver y editar dicha informaciÃ³n. </p><!-- /wp:paragraph --><!-- wp:heading --><h2>QuÃ© derechos tienes sobre tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si tienes una cuenta en este sitio, o ha dejado comentarios, puedes solicitar la exportaciÃ³n de un archivo con tus datos personales recopilados, incluyendo cualquier otro dato que nos haya proporcionado. TambiÃ©n puede solicitar la eliminaciÃ³n de cualquier dato personal que guardemos sobre ti. Esto no incluye los datos que estamos obligados a consevar para fines administrativos, legales o de seguridad.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>DÃ³nde enviamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Puede que los comentarios de los visitantes sean validados por un servicio automatico de detecciÃ³n de spam.</p><!-- /wp:paragraph -->', 'PolÃ­tica de privacidad', '', 'draft', 'closed', 'open', '', 'polÃ­tica-privacidad', '', '', '2022-02-23 14:13:32', '2022-02-23 19:13:32', '', 0, 'http://api-praxis.test/?page_id=3', 0, 'page', '', 0),
